import React from 'react';
import Header from '../../main/header/components/HeaderComponent';
import Footer from '../../main/footer/components/FooterComponent';

const EditCategoryPage = () => (
  <>
    <Header linkItem={<button type="button" className="buttonBack">Назад</button>} link="/main-page" disabled={false} />
    <div className="editCatalog-box">
      <h1 className="personalAccount"> Категории </h1>
      <div className="editCategory-table">
      <button
        type="button"
      >
        Добавить категорию
      </button>
      </div>
    </div>
    <Footer />
  </>
);

export default EditCategoryPage;
